    using Microsoft.Azure.Cosmos;
    using Newtonsoft.Json;
    using Newtonsoft.Json.Linq;
    class Program
    {
        //From Keys in portal...
        static string endpoint = "<.NET SDK URI>";
        static string authKey = "<PRIMARY KEY>";
        static CosmosClient client = new CosmosClient(endpoint, authKey);
        Container container = client.GetContainer("graphdb", "graph");

        static async Task Main(string[] args)
        {
            try
            {
                // a hardcoded json structure with large dynamic list of properties for the vertex (too big for Gremlin script):
                string sourcejsonTooBigForGremlin = "{\"name\":\"name to fill\",\"objectId\":\"guid\",\"model\":\"string\",\"type\":\"string\",\"description\":\"description to fill\",\"tags\":[\"one tag\"],\"properties\":{\"PropertyNo0\":{\"value\":\"\",\"attribute1\":\"some\",\"attribute2\":\"other\"},\"PropertyNo1\":{\"value\":\"\",\"attribute3\":4},\"PropertyNo2\":{\"value\":\"\"},\"PropertyNo3\":{\"value\":\"\"},\"PropertyNo4\":{\"value\":\"\"},\"PropertyNo5\":{\"value\":\"\"},\"PropertyNo6\":{\"value\":\"\"},\"PropertyNo7\":{\"value\":\"\"},\"PropertyNo8\":{\"value\":\"\"},\"PropertyNo9\":{\"value\":\"\"},\"PropertyNo10\":{\"value\":\"\"},\"PropertyNo11\":{\"value\":\"\"},\"PropertyNo12\":{\"value\":\"\"},\"PropertyNo13\":{\"value\":\"\"},\"PropertyNo14\":{\"value\":\"\"},\"PropertyNo15\":{\"value\":\"\"},\"PropertyNo16\":{\"value\":\"\"},\"PropertyNo17\":{\"value\":\"\"},\"PropertyNo18\":{\"value\":\"\"},\"PropertyNo19\":{\"value\":\"\"},\"PropertyNo20\":{\"value\":\"\"},\"PropertyNo21\":{\"value\":\"\"},\"PropertyNo22\":{\"value\":\"\"},\"PropertyNo23\":{\"value\":\"\"},\"PropertyNo24\":{\"value\":\"\"},\"PropertyNo25\":{\"value\":\"\"},\"PropertyNo26\":{\"value\":\"\"},\"PropertyNo27\":{\"value\":\"\"},\"PropertyNo28\":{\"value\":\"\"},\"PropertyNo29\":{\"value\":\"\"},\"PropertyNo30\":{\"value\":\"\"},\"PropertyNo31\":{\"value\":\"\"},\"PropertyNo32\":{\"value\":\"\"},\"PropertyNo33\":{\"value\":\"\"},\"PropertyNo34\":{\"value\":\"\"},\"PropertyNo35\":{\"value\":\"\"},\"PropertyNo36\":{\"value\":\"\"},\"PropertyNo37\":{\"value\":\"\"},\"PropertyNo38\":{\"value\":\"\"},\"PropertyNo39\":{\"value\":\"\"},\"PropertyNo40\":{\"value\":\"\"},\"PropertyNo41\":{\"value\":\"\"},\"PropertyNo42\":{\"value\":\"\"},\"PropertyNo43\":{\"value\":\"\"},\"PropertyNo44\":{\"value\":\"\"},\"PropertyNo45\":{\"value\":\"\"},\"PropertyNo46\":{\"value\":\"\"},\"PropertyNo47\":{\"value\":\"\"},\"PropertyNo48\":{\"value\":\"\"},\"PropertyNo49\":{\"value\":\"\"}}}";

                //We are going to upsert the vertex with dynamically added properties 
                Console.WriteLine("Upsert large vertex to graph...");
