        private async Task UpsertVertexDynamic(string sourcejson)
        {          
            //convert the json into a JObject to work with dynamically...
            JObject sourceObject = JsonConvert.DeserializeObject<dynamic>(sourcejson);
            JObject existingGraphRecord;
            try
            {
                //search for a record that corresponds with the source json's objectId
                existingGraphRecord = await container.ReadItemAsync<JObject>(sourceObject["objectId"].ToString(), new PartitionKey(sourceObject["objectId"].ToString()));
            }
            catch
            {
                existingGraphRecord = null;
            }
                
            Console.WriteLine("Existing graph record: " + existingGraphRecord);

            JObject upsertGraphObject = new JObject();
            if (existingGraphRecord != null)
            {
                upsertGraphObject = existingGraphRecord;
            }
            foreach (var element in sourceObject)
            {
                if (element.Key.Contains("objectId"))
                {
                    //set the minimum attributes required by a vertex:
                    upsertGraphObject["id"] = element.Value;
                    upsertGraphObject["label"] = "object_model";

                    //TODO - add any other non-dynamic (i.e. known) properties here

                    //in this case the graph has been partitioned by attribute "pk" and we set that to same value as objectId (id):
                    upsertGraphObject["pk"] = element.Value;
                }
                else if (element.Key.Contains("properties"))
                {
                    JObject properties = new JObject(JsonConvert.DeserializeObject<dynamic>(element.Value.ToString()));
                    foreach (var prop in properties)
                    {
                        // for each property in the source json structure, we dynamically create the Gremlin property structure required by 
                        // the SQL API backed Gremlin implementation in Azure Cosmos DB, and preserve any existing properties
                        dynamic val = new JObject(JsonConvert.DeserializeObject<dynamic>(prop.Value.ToString()));
                        JArray newPropArray = new JArray();
                        JObject newProp = new JObject();
                        Guid id = Guid.NewGuid();
                        newProp.Add("id", id);
                        newProp.Add("_value", val.value);                        
                        newPropArray.Add(newProp);
                        upsertGraphObject[prop.Key] = newPropArray;
                    }
                }
            }
            Console.WriteLine("Graph Object to be upserted: " + upsertGraphObject);
            await Update(upsertGraphObject);
        }

        private async Task Update(JObject vertex)
        {
            try
            {
                // the vertex does not need to be serialised; as long as we have built the required structure, 
                // we can upsert the dynamically constructured JObject using UpsertItemAsync()
                await container.UpsertItemAsync(vertex, new PartitionKey(vertex["pk"].ToString()));
            }
            catch (CosmosException cre)
            {
                if (cre.StatusCode.ToString().Equals("PreconditionFailed"))
                {
                    Console.WriteLine("Failed etag check");
                }
                else
                {
                    Console.WriteLine("Cosmos Exception: "+ cre);
                }
            }
        }
    }
}
